  false,\n\t\"url\": null,\n\t\"notes\": \"Executive orders are official documents,
  numbered consecutively, through which the President of the United States manages
  the operations of the Federal Government. The text of Executive orders appears in
  the daily Federal Register as each Executive order is signed by the President and
  received by the Office of the Federal Register. The text of Executive orders beginning
  with Executive Order 7316 of March 13, 1936, also appears in the sequential editions
  of Title 3 of the Code of Federal Regulations (CFR).\",\n\t\"license_title\": \"License
